import { FaShoppingCart } from "react-icons/fa";
import { NavLink } from "react-router-dom";

const Navbar = () => {
  return (
    <div>
      <div className="flex flex-row justify-between">
        <NavLink></NavLink>
        <img src="https://rb.gy/bxfguk"/>
        <div>
          <p>Home</p>
          <FaShoppingCart />
        </div>
      </div>
    </div>
  )
};

export default Navbar;
